const myImage = new Image();
myImage.src =
    "data:image/jpeg;base64,";
myImage.addEventListener("load", function () {
    const canvas = document.getElementById("canvas1");
    const ctx = canvas.getContext("2d");

    canvas.width = myImage.width;
    canvas.height = myImage.height;

    ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
    ctx.clearRect(0, 0, canvas.width, canvas.height);

    let particlesArray = [];
    const numberOfParticles = 3000;

    let mappedImage = [];
    for (let y = 0; y < canvas.height; y++) {
        let row = [];
        for (let x = 0; x < canvas.width; x++) {
            let red = pixels.data[y * 4 * pixels.width + x * 4];
            let green = pixels.data[y * 4 * pixels.width + x * 4 + 1];
            let blue = pixels.data[y * 4 * pixels.width + x * 4 + 2];
            let brightness = calculateRelativeBrightness(red, green, blue);
            let cell = [(cellBrightness = brightness), red, green, blue];
            row.push(cell);
        }
        mappedImage.push(row);
    }

    function calculateRelativeBrightness(red, green, blue) {
        return (
            Math.sqrt(
                red * red * 0.299 + green * green * 0.587 + blue * blue + 0.114
            ) / 100
        );
    }

    class Particle {
        constructor() {
            this.x = Math.random() * canvas.width;
            this.y = Math.random() * canvas.height;
            this.velocity = Math.random() * 3.5;
            this.size = Math.random() * 1.5 + 1;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = 0;
            this.info = null;
        }

        update() {
            this.info = mappedImage[this.position1][this.position2];
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = this.info[0];
            let movement = Math.abs(2.5 - this.info[0]) + this.velocity;

            this.y += movement;
            if (this.y >= canvas.height) {
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
        }

        draw() {
            ctx.beginPath();
            ctx.fillStyle =
                "rgb(" +
                this.info[1] +
                "," +
                this.info[2] +
                "," +
                this.info[3] +
                ")";
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();
        }
    }

    function init() {
        for (let i = 0; i < numberOfParticles; i++) {
            particlesArray.push(new Particle());
        }
    }

    function animate() {
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = "rgb(0, 0, 0)";
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.2;
        particlesArray.forEach((v) => {
            v.update();
            ctx.globalAlpha = v.speed * 0.5;
            v.draw();
        });
        requestAnimationFrame(animate);
    }

    init();
    animate();
});
